def is_prime(n):
    if n < 2:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    for i in range(3, int(n**0.5) + 1, 2):
        if n % i == 0:
            return False
    return True

def fibonacci(n):
    if n <= 1:
        return n
    a, b = 0, 1
    for _ in range(2, n + 1):
        a, b = b, a + b
    return b

def special_sequence(n):
    # Create a sequence where we only include Fibonacci numbers that are prime
    primes_in_fib = []
    i = 2
    while len(primes_in_fib) < n:
        fib_num = fibonacci(i)
        if is_prime(fib_num):
            primes_in_fib.append(fib_num)
        i += 1
    return primes_in_fib

# Find the 7th prime Fibonacci number
primes_in_fib = special_sequence(7)
result = primes_in_fib[6]  # 7th element (0-indexed is 6)
print(result)

